        backgroundColor: 'red',
    } 
 });


 class Homepage extends React.Component {

    constructor(props: any) {
        super(props);
    }

    render(): JSX.Element {
        return <h1 className={this.props.classes.kaas}>homepage</h1>
    }
}

export default withStyles(styles)(Homepage);
